import React from "react";
import {Card} from "react-bootstrap";
import axios from "axios";
import "./groupProjects.css";

const GroupProjects = (props) => {
return (
  <div className = "GroupProjects"> 
    <br/>
  <h4>  Group Projects </h4>
  <Card className = "project" style={{ width: "14rem" }}>
  <Card.Body>
  <Card.Title title = {props.GroupProjectTitle}></Card.Title>
  <Card.Subtitle className="mb-2 text-muted" info = {props.GroupProjectInfo}></Card.Subtitle>
  <Card.Link href = {props.GroupProjectGit} link1 ={props.GroupProjectGit}></Card.Link>
  <Card.Link href= {props.GroupProjectLink} link2 ={props.GroupProjectLink}></Card.Link>
  </Card.Body>
  </Card>
  </div>
)
}

export default GroupProjects;
